Need to generate a structured document out of MongoDB collection<p>We have a <a href="https://docs.mongodb.com/manual/core/databases-and-collections" rel="nofollow noreferrer">MongoDB collection</a> like this:</p>

<pre><code>{
        a : string, nullable
        b : string, nullable
        c : boolean, not nullable
        d : string, nullable
        e : number, nullable 
}
</code></pre>

<p>out of which we need the result like this:</p>

<pre><code>{
       ab : {
              a: &lt;count of a where a is not blank or null&gt;,
              b: &lt;count of b where b is not blank or null&gt;
            },
        c : {
              true: &lt;count of c where c true&gt;,
              false: &lt;count of c where c false&gt;
            },
        d : [&lt;all distinct/unique values of d],
        e : {
              average : &lt;average value of e&gt;,
              min     : &lt;minimum value of e&gt;,
              max     : &lt;maximum value of e&gt;
            }
}   
</code></pre>

<blockquote>
  <p>We do not wish to fire multiple <a href="https://docs.mongodb.com/manual/reference/method/db.collection.find/" rel="nofollow noreferrer"><code>find</code></a> queries and manipulate the result in-memory to bring up the results.</p>
</blockquote>

<p>How do we achieve this using MongoDB's queries only? Any suggestions will be appreciated</p>

