How the directory structure for SpringBoot MongoDB CrudRepositoryCustom Implementation should be organized?<p>I have created a simple maven project using SpringBoot and MongoDB. I have two repository implementations i.e. <em>StudentRepository</em> and  <em>StudentRepositoryCustom</em>. <em>StudentRepository</em> extends in built <em>MongoRepository</em> and the custom repository. The custom repository methods are implemented in <em>StudentRepositoryImpl</em>. The applications runs without errors when I put <strong>StudentRepository</strong>, <strong>StudentRepositoryCustom</strong> and <strong>StudentRepositoryImpl</strong> in same package i.e. <strong>com.aman.springboot.repository</strong>. But the application throws error when the implementation class is moved to some other package let's say <strong>com.aman.springboot.impl</strong>.</p>

<p>What am I doing wrong ?</p>

<p>Here's the main class:</p>

<pre><code>package com.aman.springboot.client;

@SpringBootApplication(scanBasePackages = "com.aman.springboot") 
public class ApplicationLauncher {
    public static void main(String[] args) {
        SpringApplication.run(StudentController.class, args);
    }
}
</code></pre>

<p>Here's RestController class:</p>

<pre><code>package com.aman.springboot.controller;

@RestController
@EnableAutoConfiguration
@EnableMongoRepositories(basePackages = "com.aman.springboot.repository")
@RequestMapping(value = "/student")
public class StudentController {

    @Autowired
    private StudentRepository studentRepository;

    @RequestMapping(value = "/getStudent", method = RequestMethod.GET)
    public StudentRepo getStudent(@RequestParam(required = true) int id) {
        return studentRepository.findStudentById(id);
    }

    @RequestMapping(value = "/removeStudent", method = RequestMethod.POST)
    public void removeStudent(@RequestBody(required = true) StudentRepo 
        studentRepo) {
        studentRepository.deleteStudent(studentRepo);
    }
}
</code></pre>

<p>Here's StudentRepository:</p>

<pre><code>package com.aman.springboot.repository;

@Repository
public interface StudentRepository extends MongoRepository&lt;StudentRepo, 
    String&gt;, StudentRepositoryCustom {      
    public StudentRepo findStudentById(int id);
}
</code></pre>

<p>Here's StudentRepositoryCustom:</p>

<pre><code>package com.aman.springboot.repository;

public interface StudentRepositoryCustom {
    public void deleteStudent(StudentRepo studentRepo);
}
</code></pre>

<p>Here's StudentRepositoryImpl:</p>

<pre><code>package com.aman.springboot.impl;

@Service
public class StudentRepositoryImpl implements StudentRepositoryCustom{

    @Autowired
    private MongoTemplate mongoTemplate;

    @Autowired
    private StudentRepo student;

    @Override
    public void deleteStudent(StudentRepo studentRepo) {
        mongoTemplate.remove(studentRepo);
    }
}
</code></pre>

<p>As you can see both interfaces or repositories are in same package but the implementation class for StudentRepositoryCustom interface is in different package. In this case the application throws error while deploying: </p>

