Nodejs Mongo creating collection model with a list of object where these objects are list as well<p>I want to query Mongodb to get all the cars that belong to the same company <strong>but</strong> I don't want to search the whole db and then check each car record for its company name <strong>rather</strong> I want to have a list of all the cars of that same company at one place separate in my carGarage Mongo collection so I can just get the whole list at once.</p>

<p>This is the kind of model I want : the problem is these company names are not hard-coded, i.e. if a new entry comes into database I will have to create a new list object with that name. I think that can be done just using some if conditions in the Nodejs backend.</p>

<pre><code>carsGarage {
    bmw: [
            car1 {
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;
            },
            car2 {
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;

            },car3 {
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;

            }
        ],

    jaguar: [
            car1 {
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;

            },
            car2 {
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;

            }
          ],
    ferrari [
            {-- -- --}
            {-- -- --}
            {-- -- --} 
        ]   
}
</code></pre>

<p>but after reading about Mongo, mainly about indexing, I think there is another way I can do this. So now I have the structure as:</p>

<pre><code>   carsGarage {

            car1 { bmw ,
                 Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;
            },
            car2 {bmw ,
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;
            },car3 {jaguar ,
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;
            }


            car4 { bmw,
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;
            },
            car5 { jaguar,
                Model,  Year, PriceInINR,  Trim,
                Engine, Body,color ,transmittion_type;
                dealer - id_2: &lt;&lt;
            }


            { ferrari -- -- --}
            { ferrari -- -- --}
            { ferrari -- -- --}

    }
</code></pre>

<p>The idea is to make the company name as index : so as mongo specifies when it creates  indexes, it stores them separately so it could be searched faster, --> and it is not necessary that the indexes has to be unique it can be non-unique too</p>

<p>e.g. <code>db.collection.createIndex( { name: -1 } , {unique = true})</code>, but we can just drop the <code>{unique = true}</code> option <code>db.collection.createIndex( { name: -1 })</code>.</p>

<p>So with that when I will find all the cars of any company I will get it faster.</p>

<p>This is all I can think of, am I right or not, and how can I make my model better to make my search faster?</p>

<p>for now my model in nodejs looks like this</p>

<pre><code>"use strict";

const MONGOOSE = require("mongoose"),
      DB = MONGOOSE.connection;


let carGarageSchema = MONGOOSE.Schema({

      company: { 
            type: String,
            required: true
      },
      model: {
            type: String,
            required: true
      },
      year: {
            type: Number,
            required: true
      },
      PriceInINR: {
            type: Number,
            required: true
      },
      trim: {
            type: String,
            required: true

      },
      engine: {
            type: String,
            required: true
      },
      body: {
            type: String,
            required: true
      },
      color: {
            type: String,
            required: true
      },
      transmission: {
            type: String,
            required: true
      },
      dealer_id: {
            type: String,
            required: true
      }
});

let collection_name = "carsGarage";

let carGarageModel = MONGOOSE.model(collection_name, carGarageSchema);
createAscendingIndex_on_car_make(DB);

module.exports = carGarageModel;




//   indexing  at schema level --&gt;  using node js
function createAscendingIndex_on_car_company(DB, callback) {
      let collection = DB.collection(collection_name); 

      // ? Create the index
      collection.createIndex({
